import { useState } from 'react'

function Home () {
  const [welcomeText] = useState('Search..., plan... , travel...')

  return (
    <div className='home'>
      <img className='home-logo' src={process.env.PUBLIC_URL + '/sarp-background.png'} alt="logo" />
      <div>
        {welcomeText}
      </div>
    </div>
  )
}

export default Home
